exports=async function(a,b){const{parseCatalog:c}=await require("transcode/parse_catalog");return c(`https://www.tingchina.com/yousheng/disp_${a}.htm`,[/<div class="list"><ul>(?:\s*<li class="title">名 称<\/li>)+(?<fragment>(?:\s*<li>\s*<a[^>]*>[^<]*<\/a>\s*<\/li>)+)/,/href="(?<url>[^"]+)"[^>]*>(?<name>[^<]+)/g],{clientOptions:{...(b&&b.clientOptions),encoding:"gbk","x-mobile":0}}).then(a=>{return a.forEach(a=>{a.name=a.name.replace(/\.m.+$/,"").replace("_"," ");}),a})};